import React from 'react';

function Posts({ posts }) {
  return (
    <div className="posts">
      <h2>All Posts</h2>
      {posts.length === 0 ? (
        <p>No posts yet.</p>
      ) : (
        posts.map((post, index) => (
          <div key={index} className="post">
            {post.ogImageUrl && (
              <div className="og-image-card">
                <img src={post.ogImageUrl} alt="OG" className="og-image" />
              </div>
            )}
          </div>
        ))
      )}
    </div>
  );
}

export default Posts;
